import axios from "axios";

const Weather = ({ name }) => {
  const [weather, setWeather] = useState({});
  const api_key = process.env.REACT_APP_API_KEY;
  useEffect(() => {
    axios
      .get("http://api.weatherstack.com/", { access_key: api_key })
      .then((res) => {
        console.log(res);
      });
  }, []);

  return <></>;
};

export default Weather;
